<script>
    var geojsonLayer = document.getElementsByClassName("leaflet-interactive");
    var slider = document.getElementById("opacity-slider");
    
    // Funktion zum Setzen des Hintergrunds des Sliders
    function updateSliderBackground() {
        var value = slider.value;
        var percentage = (value - slider.min) / (slider.max - slider.min) * 100;
        slider.style.background = `linear-gradient(to right, #1B3F8B ${percentage}%, white ${percentage}%)`;
    }

    // Initialer Hintergrund-Update
    updateSliderBackground();

    slider.oninput = function() {
        // Update Opazit√§t
        Array.from(geojsonLayer).forEach(function(layer) {
            layer.style.fillOpacity = parseFloat(slider.value);
        });
        // Update des Slider-Hintergrunds
        updateSliderBackground();
    }
</script>
